CREATE TABLE `seances` (
   `seance_id` int(11) not null auto_increment,
   `name` varchar(255),
   `sport_id` int(11) not null,
   `date` date,
   `calories` int(11),
   `distance` float,
   `duration` time,
   `fat_consumption` int(11),
   `above` time,
   `average` int(11),
   `below` time,
   `in_zone` time,
   `lower` int(11),
   `maximum` int(11),
   `upper` int(11),
   `Vaverage` float,
   `Vmaximum` float,
   PRIMARY KEY (`seance_id`),
   KEY `fk_sport_type` (`sport_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 AUTO_INCREMENT=310;


CREATE TABLE `sport_type` (
   `sport_id` int(11) not null,
   `sport_name` varchar(20),
   PRIMARY KEY (`sport_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

